import React, { useEffect, useState, useRef, Component }  from 'react';


function Haekchen(props) {

	let [input, setOffOrOn] = useState("bg-green-400");

	function click(){
		if (input == "bg-green-400"){
			setOffOrOn("bg-red-400")
		}	else {
			setOffOrOn("bg-green-400")
		}
	}


	return (
		<div className={"border-2 rounded-full w-6 border-blue-200 p-1" + input}
			 onClick={
			 	() => click()
			 }>
			&nsbp;
		</div>

	)


}

export default Haekchen;
